    return (<>
        <Container className='customContainer flex'>
        <img style={{width:"40%"}} src="art.jpg" alt="" />
        <div className="about">
            <h3>Hi! Welcome to my portfolio </h3>
            <h1></h1>
        </div>
        </Container>
    </>
    );
}

export default Home
